import React from 'react'
import './App.css';
import NavBar from './Navigation/NavBar';
import Footer from './Navigation/Footer';

function App() {
  return (
    <div className="App">
      <NavBar/>
      <img src='https://images.unsplash.com/photo-1606131731446-5568d87113aa?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=764&q=80' alt='burger'/>
      <Footer/>
    </div>
  );
}

export default App;
